{
  archiveVersion = "1";
  objectVersion = "46";
  objects = {
    "project" = {
      isa = "PBXProject";
      buildConfigurationList = "build configuration list";
      compatibilityVersion = "Xcode 3.2";
      mainGroup = "main group";
      projectDirPath = ".";
      targets = (
        "proofread target"
      );
    };
    "build configuration list" = {
      isa = "XCConfigurationList";
      buildConfigurations = (
        "release"
      );
    };
    "main group" = {
      isa = "PBXGroup";
      children = ();
    };
    "proofread target" = {
      isa = PBXAggregateTarget;
      buildPhases = (
        "proofread script",
      );
      name = "[*target*]";
      productName = "[*target*]";
    };
    "proofread script" = {
      isa = PBXShellScriptBuildPhase;
      shellPath = /bin/sh;
      shellScript = "[*script*]";
    };
    "release" = {
      isa = "XCBuildConfiguration";
      buildSettings = {};
      name = "Release";
    };
  };
  rootObject = "project";
}
